import './App.css';
//these below are all the same
import React from 'react';
// var { Component } = React;
// import React, { component } from 'react';







function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Coin Exchange</h2>
      </header>

    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Ticker</th>
          <th>Price</th>
        </tr>
      </thead>

      <tbody>
        <Coin name="Bitcoin" ticker="BTC" price="$9999.99" />
        <Coin name="Ethereum" ticker="ETH" price="$299.99" />

      </tbody>
    </table>

    </div>
  );
}

export default App;
